import { Link } from 'react-router-dom';
blog
const BlogList = ({recepies, title}) => {

    return ( 
        <div className="blog-list">
            <h2>{title}</h2>
            {recepies.map(recepie => (
                <div className="blog-preview" key={recepie.id}>
                    <Link to={`/blogs/${recepie.id}`}>
                        <h2>{recepie.title}</h2>

                    </Link>
                </div>
            ))}
        </div>
     );
}

export default BlogList;
